    private ObservableCollection<GeoElement> _identifiedFeatures = new();

    protected override void OnDisappearing()
    {
        base.OnDisappearing();
        Reset();
    }

    private void Reset()
    {
        GC.Collect(GC.MaxGeneration, GCCollectionMode.Forced, true, true);
        GC.Collect(GC.MaxGeneration, GCCollectionMode.Forced, true, true);
        GC.WaitForPendingFinalizers();

        _identifiedFeatures.Clear();

        MyMapView.Map?.Basemap?.BaseLayers.Clear();
        if (MyMapView.Map?.UtilityNetworks.FirstOrDefault() is UtilityNetwork un && un.Geodatabase is Geodatabase gdb)
            gdb.Close();
        MyMapView.Map?.OperationalLayers.Clear();
        MyMapView?.GraphicsOverlays?.Clear();

        _ = LoadLegendAsync();

        LoadVtpk.IsVisible = true;
        LoadGdb.IsVisible = false;
        IdentifiedFeatures.IsVisible = false;
        Progress.IsVisible = false;
    }

    public MainPage()
    {
        InitializeComponent();

        IdentifiedFeatures.ItemsSource = _identifiedFeatures;

        _identifiedFeatures.CollectionChanged += (s, e) =>
        {
            if (_identifiedFeatures.Count == 0 && IdentifiedFeatures.IsVisible)
                IdentifiedFeatures.IsVisible = false;
            else if (_identifiedFeatures.Count > 0 && !IdentifiedFeatures.IsVisible)
                IdentifiedFeatures.IsVisible = true;
        };

        MyMapView.LayerViewStateChanged += (s, e) =>
        {
            var error = e.LayerViewState.Error ?? e.Layer.LoadError;
            if (error is not null)
                System.Diagnostics.Debug.Write(error);
        };

        Reset();
    }

    private async Task LoadLegendAsync()
    {
        if (MyMapView is null || MyMapView.GraphicsOverlays?.Count > 0)
            return;

        try
        {
            Progress.IsVisible = true;
            MyMapView.GraphicsOverlays ??= new GraphicsOverlayCollection();

            var attachmentSymbol = new SimpleLineSymbol(SimpleLineSymbolStyle.ShortDot,
                Color.FromArgb(204, 118, 96, 138),
                3d);

            var attachmentSwatch = await attachmentSymbol.CreateSwatchAsync();
            AttachmentImage.Source =
                await Esri.ArcGISRuntime.Maui.RuntimeImageExtensions.ToImageSourceAsync(attachmentSwatch);

            MyMapView.GraphicsOverlays.Add(new GraphicsOverlay
            {
                Id = "Attachment",
                Renderer = new SimpleRenderer(attachmentSymbol)
            });

            var connectivitySymbol = new SimpleLineSymbol(SimpleLineSymbolStyle.ShortDot, Color.FromArgb(204, 109, 135, 100), 3d);
            var connectSwatch = await connectivitySymbol.CreateSwatchAsync();
            ConnectivityImage.Source = await Esri.ArcGISRuntime.Maui.RuntimeImageExtensions.ToImageSourceAsync(connectSwatch);
            MyMapView.GraphicsOverlays.Add(new GraphicsOverlay { Id = "Connectivity", Renderer = new SimpleRenderer(connectivitySymbol) });
        }
        catch (Exception ex)
        {
            System.Diagnostics.Debug.WriteLine(ex);
        }
        finally
        {
            Progress.IsVisible = false;
        }
    }

    private async Task LoadBasemapAsync(FileResult? fileInfo)
    {
        if (fileInfo?.FullPath is not string vtpkPath)
            return;

        MyMapView.Map?.Basemap?.BaseLayers.Clear();
        if (MyMapView.Map?.UtilityNetworks.FirstOrDefault() is UtilityNetwork un && un.Geodatabase is Geodatabase gdb)
            gdb.Close();
        MyMapView.Map?.OperationalLayers.Clear();

        var tileCache = await VectorTileCache.CreateAsync(vtpkPath);
        MyMapView.Map = new Map(new Basemap(new ArcGISVectorTiledLayer(tileCache)));
    }

    private async Task LoadUtilityNetworkAsync(FileResult? fileInfo)
    {
        #region ...
        if (MyMapView is null || MyMapView.Map is null ||
            fileInfo?.FullPath is not string gdbPath ||
            MyMapView.GraphicsOverlays?.FirstOrDefault(o => o.Id == "Attachment") is not GraphicsOverlay attachment ||
            MyMapView.GraphicsOverlays?.FirstOrDefault(o => o.Id == "Connectivity") is not GraphicsOverlay connectivity)
            return;

        if (MyMapView.Map.UtilityNetworks.FirstOrDefault() is UtilityNetwork un && un.Geodatabase is Geodatabase gdb)
            gdb.Close();

        await MyMapView.Map.LoadAsync();

        MyMapView.Map.OperationalLayers.Clear();

        var geodatabase = await Geodatabase.OpenAsync(gdbPath);
        if (geodatabase.UtilityNetworks.Count <= 0 || geodatabase.UtilityNetworks[0] is not UtilityNetwork utilityNetwork)
            return;

        MyMapView.Map.UtilityNetworks.Add(utilityNetwork);
        await utilityNetwork.LoadAsync();

        foreach (var item in RendererJsonDictionary)
        {
            if (utilityNetwork.Definition?.GetNetworkSource(item.Key)?.FeatureTable
                is not ArcGISFeatureTable table)
                continue;
            var layer = new FeatureLayer(table)
            {
                Renderer = Renderer.FromJson(item.Value)
            };
            MyMapView.Map.OperationalLayers.Add(layer);
            await layer.LoadAsync();
        }

        if (utilityNetwork.Definition?.Extent?.Buffer(150) is not Geometry bufferedExtent)
            return;

        _ = MyMapView.SetViewpointGeometryAsync(bufferedExtent);
        #endregion

        var associations = await utilityNetwork.GetAssociationsAsync(utilityNetwork.Definition.Extent);
        foreach (UtilityAssociation association in associations)
        {
            Graphic graphic = new Graphic(association.Geometry);
            graphic.Attributes["GlobalId"] = association.GlobalId;
            graphic.Attributes["AssociationType"] = association.AssociationType.ToString();
            #region ...
            graphic.Attributes["FromGlobalId"] = association.FromElement.GlobalId;
            graphic.Attributes["FromNetworkSource"] = association.FromElement.NetworkSource.Name;
            graphic.Attributes["FromAssetGroup"] = association.FromElement.AssetGroup.Name;
            graphic.Attributes["FromAssetType"] = association.FromElement.AssetType.Name;
            graphic.Attributes["ToGlobalId"] = association.ToElement.GlobalId;
            graphic.Attributes["ToNetworkSource"] = association.ToElement.NetworkSource.Name;
            graphic.Attributes["TossetGroup"] = association.ToElement.AssetGroup.Name;
            graphic.Attributes["ToAssetType"] = association.ToElement.AssetType.Name;
            #endregion
            if (association.AssociationType == UtilityAssociationType.Attachment)
                attachment.Graphics.Add(graphic);
            else if (association.AssociationType == UtilityAssociationType.Connectivity)
                connectivity.Graphics.Add(graphic);
        }
    }

    private async void OnLoadBasemap(object sender, EventArgs e)
    {
        if (sender is not VisualElement element)
            return;

        try
        {
            Progress.IsVisible = true;
            element.IsVisible = false;
            var file = await FilePicker.Default.PickAsync();
            await LoadBasemapAsync(file);
            LoadGdb.IsVisible = true;
        }
        catch (Exception ex)
        {
            System.Diagnostics.Debug.WriteLine(ex);
            element.IsVisible = true;
        }
        finally
        {
            Progress.IsVisible = false;
        }
    }

