    private async void OnGeoViewTapped(object sender, GeoViewInputEventArgs e)
    {
        try
        {
            Progress.IsVisible = true;
            _identifiedFeatures.Clear();
            var overlayResults = await MyMapView.IdentifyGraphicsOverlaysAsync(e.Position, 10, false);
            foreach (var r in overlayResults)
            {
                foreach (var g in r.Graphics)
                {
                    _identifiedFeatures.Add(g);
                }
            }

            var layerResults = await MyMapView.IdentifyLayersAsync(e.Position, 10, false);
            foreach (var r in layerResults)
            {
                foreach (var g in r.GeoElements)
                {
                    _identifiedFeatures.Add(g);
                }
            }
        }
        catch (Exception ex)
        {
            System.Diagnostics.Debug.WriteLine(ex);
        }
        finally
        {
            if (IdentifiedFeatures is not null && _identifiedFeatures.Count > 0)
            {
                IdentifiedFeatures.CurrentItem = _identifiedFeatures[0];
                IdentifiedFeatures.ScrollTo(0, ScrollToPosition.Center);
            }
            Progress.IsVisible = false;
        }
    }

    private async void OnGeoElementChanged(object sender, CurrentItemChangedEventArgs e)
    {
        if (MyMapView?.GraphicsOverlays is not IEnumerable<GraphicsOverlay> graphicsOverlays ||
            MyMapView?.Map?.OperationalLayers.OfType<FeatureLayer>() is not IEnumerable<FeatureLayer> featureLayers)
        {

            return;
        }
        Graphic? currentGraphic = e.CurrentItem as Graphic;
        Feature? currentFeature = e.CurrentItem as Feature;

        foreach (var overlay in graphicsOverlays)
        {
            overlay.ClearSelection();
            if (currentGraphic is null)
                continue;
            var graphicFound = overlay.Graphics.FirstOrDefault(g => g.Attributes["GlobalId"] == currentGraphic.Attributes["GlobalId"]);
            if (graphicFound is null)
                continue;
            overlay.SelectGraphics(new[] { graphicFound });
        }
        foreach (var featureLayer in featureLayers)
        {
            featureLayer.ClearSelection();
            if (currentFeature?.FeatureTable is null || currentFeature.FeatureTable != featureLayer.FeatureTable || featureLayer.FeatureTable is not ArcGISFeatureTable table)
                continue;
            var queryResult = await table.QueryFeaturesAsync(new QueryParameters() { WhereClause = $"{table.GlobalIdField} = '{{{currentFeature.Attributes[table.GlobalIdField]}}}'" });
            if (!queryResult.Any())
                continue;
            featureLayer.SelectFeatures(queryResult);
        }
    }

